import React from "react";

import Work from "../components/Work";

import elobe from "../img/elobe.png";

function Works() {
    return (
    <div>
        <Work title= {"ELOBE FOREST"} text={"CLT, like other mass timber products, naturally resists fire because it chars."} link={"https://elobeforest.com/"} imgSrc={elobe}/>

        <Work title= {"DOG CLASS"} text={"CLT, like other mass timber products, naturally resists fire because it chars."} link={"https://dogclass.pro/"}/>

        <Work title= {"PRISM VISUAL ARTS"} text={"CLT, like other mass timber products, naturally resists fire because it chars."} link={"https://prismvisualarts.com"}/>
    </div>
    )
}

export default Works;
